import React from 'react';

const Product = ({ product, addToCart }) => {
  return (
    <div>
      <h3>{product.title}</h3>
      <p>{product.description}</p>
      <button onClick={() => addToCart(product)}>Add to Cart</button>
    </div>
  );
};

export default Product;
